INSERT INTO `acl_roles` (`id`, `date_entered`, `date_modified`, `modified_user_id`, `created_by`, `name`, `description`, `deleted`) VALUES
('9d337519-dbf1-698d-5a1c-4d792dd7a1b3', '2011-03-10 19:59:35', '2011-03-18 16:32:16', '1', '1', 'Recruitment Coordinator', NULL, 1),
('a74ddef2-9af1-ad50-c091-4d837fe73e21', '2011-03-18 15:51:20', '2011-03-21 16:02:42', '1', '1', 'Statistician', 'Statisticians with data access privileges are able to export all data from SugarCRM, but have no rights to change or create any data unless they have another role which requires it. They also have access to a periodic report containing most of the study data, as generated by the XML conversion script for PO upload.', 0),
('960301b7-d319-9dd6-0353-4d8776641a36', '2011-03-21 16:03:37', '2011-03-21 20:21:30', '1', '1', 'Data Collector (RC/RA)', 'Research Coordinators and Research Assistants have a need to examine participant records and upcoming appointments, as well as enter information about their completed appointments. There also is a need to track specimen information.', 0),
('23f75bf8-3539-7590-5f06-4d87b37f3871', '2011-03-21 20:23:11', '2011-04-01 21:09:07', '1', '1', 'Call Center Staff', 'Call Center Employees need to access participant records as well as a history of notes and past PPG screeners. They are only able to create PPG records and not edit or delete them after creation', 0),
('31a38471-8952-fba5-e2b7-4d87c9b4fbc2', '2011-03-21 21:55:20', '2011-03-21 22:03:24', '1', '1', 'All Disabled', NULL, 1),
('a9c9914a-fc3a-3fe3-a705-4d87c9608dd4', '2011-03-21 21:57:24', '2011-03-21 22:03:18', '1', '1', 'Account edit', NULL, 1),
('7df3b3b7-7261-02dd-6b10-4d892e156c27', '2011-03-22 23:19:26', '2011-03-23 23:03:21', '1', '1', 'Demo', NULL, 1),
('ba9146c5-9228-228c-dec2-4d96311bdd25', '2011-04-01 20:13:11', '2011-04-01 20:14:07', '1', '1', 'Continuous Enumeration Coordinator ', 'Continuous Enumeration Coordinator is the only one with the ability to create or modify Dwelling Unit records that represent the addresses of participants.', 0),
('2308f41d-bdcf-edd9-cb0c-4d963c5ee0c1', '2011-04-01 20:58:28', '2011-04-01 20:58:28', '1', '1', 'Program Manager', 'Supervisors of their respective domains have a need to audit records changed recently, as well as be able to oversee and perform the work of subordinate employees.', 0),
('5752019f-1604-bb80-9411-4d963dbfbaab', '2011-04-01 21:03:20', '2011-04-01 21:03:20', '1', '1', 'Supervisor (Call Center)', 'Supervisor for the Call Center has to audit records changed recently, as well as be able to oversee and perform the work of subordinate employees in the Call Center.', 0);
